CREATE TABLE `tblnotifications` (
  `intNotificationID` int(12) NOT NULL,
  `intStudentID` int(7) NOT NULL,
  `intFacultyID` int(7) NOT NULL,
  `strNotification` varchar(140) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `tblpictureid` (
  `intExternalID` int(7) NOT NULL,
  `vntImage` varchar(32) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `tblroom` (
  `intRoomID` int(5) NOT NULL,
  `intFacilityID` int(7) NOT NULL,
  `intRoomNumber` int(5) DEFAULT NULL,
  `intSeats` int(3) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `tblsectionschedule` (
  `intTimeSlotID` int(3) NOT NULL,
  `strDayFormat` int(5) NOT NULL,
  `timeStart` time NOT NULL,
  `timeEnd` time NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
